import axios from 'axios'


class Form extends Component {

state = {
    formState: ""
}
componentDidMount(){
axios.get("https://jsonplaceholder.typicode.com/posts")
.then((response)=>{
    this.setState({
        formState: response
    })
})

}


render() {
    return (
        <div>
           <h1> Form Page</h1>
        </div>
    )
}
}
export default Form
